import React from "react";
import { Link } from "react-router-dom";
import logo from "../assest/logo.png";

function Headers() {
  // <div className="lg:flex md:block hidden lg:justify-start md:justify-end justify-center items-center lg:pl-[21rem] md:pl-6 pl-4 ">
  return (
    <div className="fixed shadow-md w-full flex  h-16">
      <Link to={""}>
        <div className=" h-12 flex w-full self-center items-center px-2">
          <img src={logo} className="h-10" />
        </div>
      </Link>
    </div>
  );
}

export default Headers;
